    false,nt"url": null,nt"notes": "The progress report covers the period from
    01 July 1965 to 30 June 1966. The main purpose of the report is to provide cooperating
    investigators with field and cruise data pertinent to their projects, and a view
    of the principles guiding the program. Hopefully, this report will also provide
    potential investigators with the informations required to submit proposals and successfully
    conduct research and training cruises aboard the R/V EASTWARD.nnThe Cooperative
    Program of Research and Training in Biological Oceanography is supported by the
    National Science Foundation and by Duke University, and is located at the Duke University
